import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from "react-router-dom";
import GraphInput from "./components/GraphInput";
import GraphVisualization from "./components/GraphVisualization";
import Algorithms from "./components/Algorithms";
import "./styles/App.css";

function HomePage({ onStart }) {
  return (
    <div className="start-page">
      <header>
        <h1>Website Wireframe</h1>
      </header>
      <div className="main">
        <div className="card">
          <h2>Your Graph Algorithm</h2>
          <Link to="/graph">
            <button
              className="start-button"
              onClick={() => onStart("graph")}
            >
              Start
            </button>
          </Link>
        </div>
        <div className="card">
          <h2>Your Data Structure</h2>
          <Link to="/data-structure">
            <button
              className="start-button"
              onClick={() => onStart("data-structure")}
            >
              Start
            </button>
          </Link>
        </div>
      </div>
      <footer>
        <p>Internet of Things</p>
        <p>2025</p>
      </footer>
    </div>
  );
}

function GraphPage({ resetGraph }) {
  const [matrix, setMatrix] = useState([]); // Матриця суміжності
  const [vertices, setVertices] = useState([]); // Вершини графа

  const handleMatrixSubmit = (newMatrix) => {
    setMatrix(newMatrix);
    setVertices(generateVertices(newMatrix.length));
  };

  const generateVertices = (count) => {
    const angleStep = (2 * Math.PI) / count;
    const radius = 150;

    return Array.from({ length: count }, (_, i) => ({
      x: 300 + radius * Math.cos(i * angleStep),
      y: 300 + radius * Math.sin(i * angleStep),
    }));
  };

  return (
    <div>
      <header>
        <h1>Graph Algorithms Visualization</h1>
        <Link to="/">
          <button className="back-button" onClick={resetGraph}>
            Back to Home
          </button>
        </Link>
      </header>
      <GraphInput onMatrixSubmit={handleMatrixSubmit} />
      <GraphVisualization matrix={matrix} vertices={vertices} />
      <Algorithms matrix={matrix} />
    </div>
  );
}

function App() {
  const navigate = useNavigate();
  const [mode, setMode] = useState("");

  const handleStart = (selectedMode) => {
    setMode(selectedMode);
  };

  const resetGraph = () => {
    setMode(""); // Скидає вибраний режим
  };

  return (
    <Routes>
      <Route path="/" element={<HomePage onStart={handleStart} />} />
      <Route
        path="/graph"
        element={<GraphPage resetGraph={resetGraph} />}
      />
      <Route
        path="/data-structure"
        element={
          <div>
            <header>
              <h1>Data Structure Visualization</h1>
              <Link to="/">
                <button className="back-button" onClick={resetGraph}>
                  Back to Home
                </button>
              </Link>
            </header>
            <p>Data Structure functionality will be here</p>
          </div>
        }
      />
    </Routes>
  );
}

export default function AppWrapper() {
  return (
    <Router>
      <App />
    </Router>
  );
}
